import org.junit.jupiter.params.ParameterizedTest;
import org.junit.jupiter.params.provider.ValueSource;
import java.util.Base64;
import java.nio.charset.StandardCharsets;
import static org.junit.jupiter.api.Assertions.assertEquals;

public class Base64CycleTest {

    @ParameterizedTest
    @ValueSource(strings = {"", "Zg==", "Zm8=", "Zm9v", "Zm9vYg==", "Zm9vYmE=", "Zm9vYmFy"})
    void testBase64Cycle(String original_base64_string) {
        byte[] decoded_byte_array = Base64.getDecoder().decode(original_base64_string);
        String decoded_text = new String(decoded_byte_array, StandardCharsets.US_ASCII);
        byte[] utf8_bytes = decoded_text.getBytes(StandardCharsets.UTF_8);
        String re_encoded_string = Base64.getEncoder().encodeToString(utf8_bytes);
        assertEquals(original_base64_string, re_encoded_string);
    }
}

