public class Crc16CustomInitialValueTest {

    private static final byte[] PREDEFINED_BYTE_ARRAY = {'1', '2', '3', '4', '5', '6', '7', '8', '9'};

    private void updateChecksum(final Checksum checksum) {
        checksum.update(PREDEFINED_BYTE_ARRAY, 0, PREDEFINED_BYTE_ARRAY.length);
    }

    @Test
    public void testCrc16WithCustomInitialValue() {
        // Step 0: Create a CRC16.Builder instance.
        final Crc16.Builder crc16Builder = Crc16.builder();

        // Step 1: Get the Modbus lookup table.
        final int[] modbusTable = Crc16.getModbusTable();

        // Step 2: Configure the builder with the Modbus lookup table and an initial value of 0xFFFF.
        final Crc16.Builder configuredBuilder = crc16Builder.setTable(modbusTable).setInit(0xFFFF);

        // Step 3: Build the checksum calculator.
        final Crc16 checksumCalculator = configuredBuilder.get();

        // Step 4: The predefined byte array is defined as a class constant.

        // Step 5: Update the checksum calculator with the byte array segment.
        updateChecksum(checksumCalculator);

        // Step 6: Retrieve the current checksum value.
        long checksumValue = checksumCalculator.getValue();

        // Step 7: Assert the checksum value equals 0x4B37.
        assertEquals(0x4B37L, checksumValue);

        // Step 8: Update the same calculator instance again with the byte array segment.
        updateChecksum(checksumCalculator);

        // Step 9: Retrieve the current checksum value.
        checksumValue = checksumCalculator.getValue();

        // Step 10: Assert the checksum value equals 0x090A.
