package org.apache.commons.codec.digest;

import static org.junit.jupiter.api.Assertions.assertEquals;
import static org.junit.jupiter.api.Assertions.assertNotEquals;

import org.junit.jupiter.api.Test;

public class Crc16Test1 {

    @Test
    public void testChecksumCalculatorLifecycle() {
        // Setup: Configure the checksum calculator
        int starting_reference_value = 0x1D0F;
        int[] predefined_lookup_pattern = new int[256];
        for (int i = 0; i < 256; i++) {
            predefined_lookup_pattern[i] = (i * 0x1021) & 0xFFFF;
        }

        Crc16.Builder builder = Crc16.builder();
        builder.setInit(starting_reference_value);
        builder.setTable(predefined_lookup_pattern);
        Crc16 checksum_calculator = builder.get();

        // Establish data and expected signatures
        byte[] standard_data_payload = "test data".getBytes();
        long expected_first_signature = 39914L;
        long expected_accumulated_signature = 38669L;

        // 1. Process payload and verify the first signature
        checksum_calculator.update(standard_data_payload, 0, standard_data_payload.length);
        long first_computed_signature = checksum_calculator.getValue();
        assertEquals(expected_first_signature, first_computed_signature, "First signature should match expected value");

        // 2. Process the same payload again and verify the accumulated signature
        checksum_calculator.update(standard_data_payload, 0, standard_data_payload.length);
        long second_computed_signature = checksum_calculator.getValue();
        assertNotEquals(first_computed_signature, second_computed_signature, "Accumulated signature should be different");
        assertEquals(expected_accumulated_signature, second_computed_signature, "Accumulated signature should match expected value");

        // 3. Reset the calculator and verify it returns to the initial state
        checksum_calculator.reset();
        checksum_calculator.update(standard_data_payload, 0, standard_data_payload.length);
        long third_computed_signature = checksum_calculator.getValue();
        assertEquals(expected_first_signature, third_computed_signature, "Signature after reset should match the first signature");
    }
}

