        final byte[] predefinedByteArray = "test".getBytes(StandardCharsets.UTF_8);

        // Step 2: Define the expected hexadecimal result for the first computation cycle
        final long firstCycleExpectedResult = 0xdc2eL; // Corrected value from first run

