import static org.junit.jupiter.api.Assertions.assertEquals;

public class Crc16Test1 {

    @Test
    public void testCrc16Modbus() {
        // Step 0: Configure the checksum calculator with the Modbus lookup reference
        final int[] modbus_table = Crc16.getModbusTable();

        // Step 1: Initialize the calculator with a starting baseline value
        final Crc16 calculator = Crc16.builder()
                .setTable(modbus_table)
                .setInit(0xFFFF)
                .get();

        // Step 2: Define a predefined sequence of data elements
        final byte[] data_sequence = new byte[]{0x01, 0x02, 0x03, 0x04, 0x05};

        // Step 3: Define the expected checksum for the data sequence
        final long expected_checksum = 47914L;

        // Step 4: Process each element from the data sequence with the calculator
        calculator.update(data_sequence, 0, data_sequence.length);

        // Step 5: Get the actual checksum value
        final long actual_checksum = calculator.getValue();

        // Step 6: Assert the actual checksum matches the expected checksum
        assertEquals(expected_checksum, actual_checksum);
    }
}

