package org.apache.commons.codec.digest;

import org.junit.jupiter.params.ParameterizedTest;
import org.junit.jupiter.params.provider.CsvSource;
import static org.junit.jupiter.api.Assertions.assertEquals;

import java.nio.charset.StandardCharsets;

public class Crc16Test1 {

    @ParameterizedTest
    @CsvSource("'123456789', 0xB4C8")
    void testCrc16Usb(String sourceString, long expectedChecksum) {
        // Step 1: Instantiate a CRC16-USB checksum calculator
        Crc16 checksumCalculator = Crc16.usb();

        // Step 2: Convert the source string into a US-ASCII encoded byte array
        byte[] byteArray = sourceString.getBytes(StandardCharsets.US_ASCII);

        // Step 3: Invoke the update method on the checksum calculator
        checksumCalculator.update(byteArray, 0, byteArray.length);

        // Step 4: Retrieve the computed checksum value
        long computedChecksum = checksumCalculator.getValue();

        // Step 5: Assert that the computed checksum matches the expected value
        assertEquals(expectedChecksum, computedChecksum, () -> "Checksum mismatch");

        // Step 6: Reset the checksum calculator to its initial state
        checksumCalculator.reset();

        // Step 7: Invoke the update method again
        checksumCalculator.update(byteArray, 0, byteArray.length);

        // Step 8: Retrieve the checksum value after the reset and update cycle
        long resetComputedChecksum = checksumCalculator.getValue();

        // Step 9: Assert that the checksum after reset still matches the expected value
        assertEquals(expectedChecksum, resetComputedChecksum, () -> "Checksum mismatch after reset");
    }
}

