import static org.junit.jupiter.api.Assertions.assertEquals;

import java.util.function.Supplier;
import java.util.stream.Stream;
import java.util.zip.Checksum;

import org.apache.commons.codec.binary.StringUtils;
import org.junit.jupiter.params.ParameterizedTest;
import org.junit.jupiter.params.provider.Arguments;
import org.junit.jupiter.params.provider.MethodSource;

public class Crc16Test1 {

    private static final String BIG_TEXT = "This is a big text for testing purposes.";
    private static final byte[] TEST_BYTES = StringUtils.getBytesUsAscii("123456789");
    private static final int TEST_BYTES_LEN = TEST_BYTES.length;

    private static Stream<Arguments> testCrc16Usb() {
        return Stream.of(
            Arguments.of("123456789", 0xB4C8L)
        );
    }

    private Supplier<String> messageSupplier(final Checksum crc, final long expected) {
        return () -> "crc=" + crc.getValue() + ", expected=" + expected;
    }

    @ParameterizedTest
    @MethodSource("testCrc16Usb")
    public void testCrc16Usb(final String source, final long expected) {
        final Checksum crc16 = Crc16.usb();
        final byte[] bytes = StringUtils.getBytesUsAscii(source);
        crc16.update(bytes, 0, bytes.length);
        long actual = crc16.getValue();
        assertEquals(expected, actual, messageSupplier(crc16, expected));

        crc16.reset();
        crc16.update(bytes, 0, bytes.length);
        actual = crc16.getValue();
        assertEquals(expected, actual, messageSupplier(crc16, expected));
    }
}

