import java.io.ByteArrayInputStream;
import java.io.InputStream;
import java.util.Arrays;
import java.util.stream.Stream;

import org.apache.commons.codec.binary.BinaryCodec;
import org.apache.commons.codec.binary.Hex;
import org.apache.commons.lang3.StringUtils;
import org.junit.jupiter.params.ParameterizedTest;
import org.junit.jupiter.params.provider.Arguments;
import org.junit.jupiter.params.provider.MethodSource;

public class DigestUtilsShake128_256Test {

    private static final int SHAKE128_256_BYTE_LENGTH = 32;

    private static Stream<Arguments> shake128_256Samples() {
        return Stream.of(
                Arguments.of("01", 256, "f4202e5c82145d82332b3410282a456a33626a73f32ad851f10a108e1d426f5c"));
    }

    private String clean(final String text) {
        return text.replaceAll("\\s", "").toLowerCase();
    }

    private boolean isJava25OrLater() {
        final String version = System.getProperty("java.version");
        try {
            final int major = Integer.parseInt(version.split("\\.")[0]);
            return major >= 25;
        } catch (final NumberFormatException e) {
            // Fallback for non-standard version strings
            return version.startsWith("25.") || version.startsWith("26.");
        }
    }

    @ParameterizedTest
    @MethodSource("shake128_256Samples")
    public void testShake128_256(final String binaryInputText, final int inputBitSize, final String hexOutputText) throws Exception {
        final String cleanedBinaryString = clean(binaryInputText);
        final String reversedBinaryString = StringUtils.reverse(cleanedBinaryString);
        final byte[] inputByteArray = new BinaryCodec().toByteArray(reversedBinaryString);
        final InputStream inputStream = new ByteArrayInputStream(inputByteArray);

        final String cleanedHexString = clean(hexOutputText);
        final String expectedResultHexString = cleanedHexString.substring(0, SHAKE128_256_BYTE_LENGTH * 2);
        final byte[] decodedHexBytes = Hex.decodeHex(expectedResultHexString);
        final byte[] expectedResultBytes = Arrays.copyOf(decodedHexBytes, inputBitSize / 8);

        if (isJava25OrLater()) {
            final byte[] actualResultBytesFromArray = DigestUtils.shake128_256(inputByteArray);
            assertArrayEquals(expectedResultBytes, actualResultBytesFromArray);

            final byte[] actualResultBytesFromStream = DigestUtils.shake128_256(inputStream);
            assertArrayEquals(expectedResultBytes, actualResultBytesFromStream);

            final String actualResultHexFromArray = DigestUtils.shake128_256Hex(inputByteArray);
            assertEquals(expectedResultHexString, actualResultHexFromArray);

            // Reset stream for second read
