import static org.junit.jupiter.api.Assumptions.assumeFalse;
import static org.junit.jupiter.api.Assumptions.assumeTrue;

import java.io.ByteArrayInputStream;
import java.io.IOException;
import java.math.BigInteger;
import java.util.stream.Stream;

import org.apache.commons.codec.DecoderException;
import org.apache.commons.codec.binary.Hex;
import org.junit.jupiter.params.ParameterizedTest;
import org.junit.jupiter.params.provider.Arguments;
import org.junit.jupiter.params.provider.MethodSource;

public class DigestUtilsShake128_256Test {

    private static byte[] fromBinaryString(String binaryString) {
        String noWhitespace = binaryString.replaceAll("\\s", "");
        String reversed = new StringBuilder(noWhitespace).reverse().toString();
        if (reversed.isEmpty()) {
            return new byte[0];
        }
        byte[] bytes = new BigInteger(reversed, 2).toByteArray();
        // BigInteger adds a sign bit, we need to remove it if it's a leading zero byte
        if (bytes.length > 1 && bytes[0] == 0) {
            byte[] tmp = new byte[bytes.length - 1];
            System.arraycopy(bytes, 1, tmp, 0, tmp.length);
            bytes = tmp;
        }
        return bytes;
    }

    static Stream<Arguments> testParameters() {
        final String binaryText = "";
        final int bitLength = 0;
        final String hexDigest = "7F9C2BA4 E88F82DC 0B656725 6A552FC2 5B096446 24469C76 5E78506D C58587E0";
        return Stream.of(
            Arguments.of(binaryText, bitLength, hexDigest, true),
            Arguments.of(binaryText, bitLength, hexDigest, false)
        );
    }

    @ParameterizedTest
    @MethodSource("testParameters")
    public void testShake128_256(String binaryTextRepresentation, int expectedBitLength, String hexadecimalDigestText, boolean supported) throws IOException, DecoderException {
        final byte[] binaryInputData = fromBinaryString(binaryTextRepresentation);
        assertEquals(expectedBitLength, binaryInputData.length * 8, "Bit length of input data");

        if (supported) {
            assumeTrue(DigestUtils.isAvailable("SHAKE128-256"), "SHAKE128-256 should be supported");

            final String expectedHexOutput = hexadecimalDigestText.replaceAll("[\\s:]", "").substring(0, 64);
            final byte[] expectedBinaryOutput = Hex.decodeHex(expectedHexOutput);

            // Test with byte array
            final byte[] actualBinaryDigest = DigestUtils.shake128_256(binaryInputData);
            assertArrayEquals(expectedBinaryOutput, actualBinaryDigest, "Binary digest from byte array");

            // Test with InputStream
            final byte[] actualStreamDigest = DigestUtils.shake128_256(new ByteArrayInputStream(binaryInputData));
            assertArrayEquals(expectedBinaryOutput, actualStreamDigest, "Binary digest from stream");

            // Test with hex output from byte array
            final String actualHexDigest = DigestUtils.shake128_256Hex(binaryInputData);
            assertEquals(expectedHexOutput, actualHexDigest, "Hex digest from byte array");

            // Test with hex output from InputStream
            final String actualStreamHexDigest = DigestUtils.shake128_256Hex(new ByteArrayInputStream(binaryInputData));
            assertEquals(expectedHexOutput, actualStreamHexDigest, "Hex digest from stream");

        } else {
            assumeFalse(DigestUtils.isAvailable("SHAKE128-256"), "SHAKE128-256 should not be supported");

            assertThrows(IllegalArgumentException.class, () -> DigestUtils.shake128_256(binaryInputData), "Binary digest should throw");
            assertThrows(IllegalArgumentException.class, () -> DigestUtils.shake128_256(new ByteArrayInputStream(binaryInputData)), "Stream digest should throw");
            assertThrows(IllegalArgumentException.class, () -> DigestUtils.shake128_256Hex(binaryInputData), "Hex digest from binary should throw");
            assertThrows(IllegalArgumentException.class, () -> DigestUtils.shake128_256Hex(new ByteArrayInputStream(binaryInputData)), "Hex digest from stream should throw");
        }
    }
}

