    private static final String SHAKE256_MSG_0_HEX = "46b9dd2b0ba88d13233b3feb743eeb243fcd52ea62b81b82b50c27646ed5762fd75dc4ddd8c0f200cb05019d67b592f6fc821c49479ab48640292eacb3b7c4be";
    private static final String SHAKE256_MSG_1600_HEX = "73c28756e73740259443513f56350a9b3a042d1852980337f83203f251a6306e57342894321149d3c99026bb5359481332710328718be03434c99a5307d519d0";

    private final byte[] testData = new byte[1024];
    private Path testFile;
    private Path testRandomAccessFile;
    private RandomAccessFile testRandomAccessFileWrapper;

    @BeforeEach
    public void setUp() throws IOException {
