        if (testRandomAccessFileWrapper != null) {
            testRandomAccessFileWrapper.close();
        }
        Files.deleteIfExists(testFile);
        Files.deleteIfExists(testRandomAccessFile);
    }

    private String cleanString(final String input) {
        return StringUtils.replaceChars(input, " ", "").toLowerCase(Locale.ROOT);
    }

    private boolean isJavaVersionAtLeast25() {
        return SystemUtils.isJavaVersionAtLeast(JavaVersion.JAVA_25);
    }

    private byte[] binaryToByteArray(final String binary) {
        final int inLen = binary.length();
        if (inLen % Byte.SIZE != 0) {
            throw new IllegalArgumentException(String.format("Binary string length must be a multiple of %,d.", Byte.SIZE));
        }
        final byte[] byteArray = new byte[inLen / Byte.SIZE];
        for (int i = 0, j = 0; i < byteArray.length; i++, j += Byte.SIZE) {
            byteArray[i] = (byte) Integer.parseInt(binary.substring(j, j + Byte.SIZE), 2);
        }
        return byteArray;
    }

    private static Stream<Arguments> testShake256_512() {
        return Stream.of(
                Arguments.of(SHAKE256_MSG_0, 0, SHAKE256_MSG_0_HEX),
                Arguments.of(SHAKE256_MSG_1600, 1600, SHAKE256_MSG_1600_HEX)
        );
    }

    @ParameterizedTest
    @MethodSource
    public void testShake256_512(final String binaryInputText, final int inputBitSize, final String hexOutputText) throws Exception {
        final String cleanBinary = cleanString(binaryInputText);
        final String cleanBinaryInput = StringUtils.reverse(cleanBinary);
        final byte[] bytesInput = binaryToByteArray(cleanBinaryInput);

        final String resultString = cleanString(hexOutputText).substring(0, SHAKE128_512_BYTE_LEN * 2);
        final byte[] resultBytes = Arrays.copyOf(Hex.decodeHex(resultString), SHAKE128_512_BYTE_LEN);

        if (isJavaVersionAtLeast25()) {
            final byte[] shake256_512_result = DigestUtils.shake256_512(new ByteArrayInputStream(bytesInput));
            assertArrayEquals(resultBytes, shake256_512_result);

            final String shake256_512Hex_result = DigestUtils.shake256_512Hex(new ByteArrayInputStream(bytesInput));
            assertEquals(resultString, shake256_512Hex_result);
        } else {
            assertThrows(IllegalArgumentException.class, () -> DigestUtils.shake256_512(bytesInput));
            assertThrows(IllegalArgumentException.class, () -> DigestUtils.shake256_512(new ByteArrayInputStream(bytesInput)));
            assertThrows(IllegalArgumentException.class, () -> DigestUtils.shake256_512Hex(bytesInput));
            assertThrows(IllegalArgumentException.class, () -> DigestUtils.shake256_512Hex(new ByteArrayInputStream(bytesInput)));
        }
    }
}

