        this.tempFile = Files.createTempFile("test", ".txt");
        Files.write(this.tempFile, "test data".getBytes(StandardCharsets.UTF_8));
    }

    @AfterEach
    void tearDown() throws Exception {
        // Step 9: Delete the temporary file
        Files.deleteIfExists(this.tempFile);
    }

    static Stream<Arguments> algorithmProvider() {
        return Stream.of(
            Arguments.of("HmacSHA1", "6be3ce71235d1d038b6e76b0e009feb29b8e3556"),
            Arguments.of("HmacSHA256", "7a8bfa0841d98270cca48e0092e1ed59d2d3f1b3e95467deed4b1917a56a43f4"),
            Arguments.of("HmacSHA512", "69982d761ee96e0b99c544a25af9c0ebbeb34c20ffb376f08503109615959c41b018bc445d12eb9c949b64728c0f8c1a658a1fd009bdcb7bf0fbfc703baa199d")
        );
    }

    @ParameterizedTest
    @MethodSource("algorithmProvider")
    void testMessageAuthentication(String authentication_algorithm, String expected_authentication_output) throws Exception {
        // Step 0: Create a secret key
        Key secret_key = new SecretKeySpec("test secret".getBytes(StandardCharsets.UTF_8), authentication_algorithm);

        // Step 3: Confirm the requested authentication algorithm is available
        Mac mac_instance;
        try {
            mac_instance = Mac.getInstance(authentication_algorithm);
            Assumptions.assumeTrue(true);
        } catch (NoSuchAlgorithmException e) {
            Assumptions.assumeTrue(false, "Algorithm not available: " + authentication_algorithm);
            return; // Skip test if algorithm is not supported
        }

        // Step 4: Initialize the MAC instance
        mac_instance.init(secret_key);

        // Step 5: Read all bytes from the temporary file
        byte[] document_bytes = Files.readAllBytes(this.tempFile);

        // Step 6: Compute the final MAC signature
        byte[] signature_bytes = mac_instance.doFinal(document_bytes);

        // Step 7: Encode the signature bytes to a hex string
        String hex_signature = Hex.encodeHexString(signature_bytes);

        // Step 8: Assert the generated hex signature matches the expected output
        Assertions.assertEquals(expected_authentication_output, hex_signature);
    }
}

