import java.security.NoSuchAlgorithmException;
import java.util.stream.Stream;

public class HmacAuthenticationTest {

    private static Stream<Arguments> algorithmAndExpectedCodeProvider() {
        return Stream.of(
                Arguments.of("HmacMD5", "494c18b356cb19c61659a37ec38f2d94"),
                Arguments.of("HmacSHA1", "ba9b38eb0a933dec94273736e6053edf7f00c314"),
                Arguments.of("HmacSHA256", "7e73ad1085ba8d321dbc7f864da512a2b8bfd19dc68917d801ccdbb230f5ac22"),
                Arguments.of("HmacSHA384", "1ce80ffa179baad8ab27e6b36ba3cbcd7b4126d3e664e608e6bb5a3d1659731b73f09b90e6430aebcfa4989aea4d9300"),
                Arguments.of("HmacSHA512", "8c465556489d68ddb8c6bbec64bbeef8f1447ea7e4bf354d68b9f30afab750e78ddc802e1e3cd120b8c85cca0290c518a45a03dc8e9668014e55a8e326ba1bad")
        );
    }

    @ParameterizedTest
    @MethodSource("algorithmAndExpectedCodeProvider")
    void testHmacAlgorithms(String algorithm, String expectedHex) throws Exception {
        try {
            Mac.getInstance(algorithm);
        } catch (NoSuchAlgorithmException e) {
            Assumptions.assumeTrue(false, "Algorithm not supported: " + algorithm);
        }

        SecretKeySpec secretKey = new SecretKeySpec("my-secret-key".getBytes(), algorithm);
        Mac mac = Mac.getInstance(algorithm);
        mac.init(secretKey);

        InputStream dataStream = new ByteArrayInputStream("The quick brown fox jumps over the lazy dog".getBytes());

        byte[] buffer = new byte[1024];
        int bytesRead;
        while ((bytesRead = dataStream.read(buffer)) != -1) {
            mac.update(buffer, 0, bytesRead);
        }

        byte[] macBytes = mac.doFinal();
        String actualHex = bytesToHex(macBytes);

        Assertions.assertEquals(expectedHex, actualHex);
    }

    private static String bytesToHex(byte[] bytes) {
        StringBuilder hexString = new StringBuilder(2 * bytes.length);
        for (byte b : bytes) {
            String hex = Integer.toHexString(0xff & b);
            if (hex.length() == 1) {
                hexString.append('0');
            }
            hexString.append(hex);
        }
        return hexString.toString();
    }
}

