package org.apache.commons.codec.language;

import org.junit.jupiter.api.Test;
import static org.junit.jupiter.api.Assertions.assertTrue;

public class PhoneticNameMatcherTest {

    @Test
    public void testWhitespaceHandlingInPhoneticMatching() {
        Metaphone matcher = new Metaphone();

        // Baseline: no whitespace
        String name1 = "Smith";
        String name2 = "Smyth";
        boolean matchResult = matcher.isMetaphoneEqual(name1, name2);
        assertTrue(matchResult, "Baseline comparison failed");

        // Leading whitespace in first name
        String name1WithLeadingWhitespace = " Smith";
        matchResult = matcher.isMetaphoneEqual(name1WithLeadingWhitespace, name2);
        assertTrue(matchResult, "Leading whitespace in first name failed");

        // Trailing whitespace in first name
        String name1WithTrailingWhitespace = "Smith ";
        matchResult = matcher.isMetaphoneEqual(name1WithTrailingWhitespace, name2);
        assertTrue(matchResult, "Trailing whitespace in first name failed");

        // Surrounding whitespace in first name
        String name1WithSurroundingWhitespace = " Smith ";
        matchResult = matcher.isMetaphoneEqual(name1WithSurroundingWhitespace, name2);
        assertTrue(matchResult, "Surrounding whitespace in first name failed");

        // Leading whitespace in second name
        String name2WithLeadingWhitespace = " Smyth";
        matchResult = matcher.isMetaphoneEqual(name1, name2WithLeadingWhitespace);
        assertTrue(matchResult, "Leading whitespace in second name failed");

        // Trailing whitespace in second name
        String name2WithTrailingWhitespace = "Smyth ";
        matchResult = matcher.isMetaphoneEqual(name1, name2WithTrailingWhitespace);
        assertTrue(matchResult, "Trailing whitespace in second name failed");

        // Surrounding whitespace in second name
        String name2WithSurroundingWhitespace = " Smyth ";
        matchResult = matcher.isMetaphoneEqual(name1, name2WithSurroundingWhitespace);
        assertTrue(matchResult, "Surrounding whitespace in second name failed");
    }
}

