public class RuleTest1 {

    @Test
    public void testParsePhonemeExpr() {
        // Step 0, 1, 2
        final PhonemeExpr phonemeExpr1 = Rule.parsePhonemeExpr("()");
        final int size1 = phonemeExpr1.size();
        assertEquals(1, size1);

        // Step 3, 4, 5
        final PhonemeExpr phonemeExpr2 = Rule.parsePhonemeExpr("(())");
        final int size2 = phonemeExpr2.size();
        assertEquals(1, size2);

        // Step 6, 7, 8
        final PhonemeExpr phonemeExpr3 = Rule.parsePhonemeExpr("(|)");
        final int size3 = phonemeExpr3.size();
        assertEquals(2, size3);

        // Step 9, 10, 11
        final PhonemeExpr phonemeExpr4 = Rule.parsePhonemeExpr("(|)");
        final int size4 = phonemeExpr4.size();
        assertEquals(2, size4);

        // Step 12, 13, 14
        final PhonemeExpr phonemeExpr5 = Rule.parsePhonemeExpr("(||)");
        final int size5 = phonemeExpr5.size();
        assertEquals(3, size5);
    }
}

package org.apache.commons.codec.language.bm;

import org.junit.jupiter.api.Assertions;
import org.junit.jupiter.api.Test;

/**
 * Test for {@link Rule}.
 */
public class RuleTest1 {

    @Test
    public void testParsePhonemeExpr() {
        // Step 1 & 2: Parse a simple empty grouping pattern and verify the number of alternatives is 1.
        Rule.PhonemeExpr phonemeExpr1 = Rule.parsePhonemeExpr("()");
        Assertions.assertEquals(1, phonemeExpr1.size());

        // Step 3 & 4: Parse a nested empty grouping pattern and verify the number of alternatives is 1.
        Rule.PhonemeExpr phonemeExpr2 = Rule.parsePhonemeExpr("(())");
        Assertions.assertEquals(1, phonemeExpr2.size());

        // Step 5 & 6: Parse a pattern with an empty alternative and an empty grouping, verify 2 alternatives.
        Rule.PhonemeExpr phonemeExpr3 = Rule.parsePhonemeExpr("|()");
        Assertions.assertEquals(2, phonemeExpr3.size());

        // Step 7 & 8: Parse a pattern with an empty grouping and an empty alternative, verify 2 alternatives.
        Rule.PhonemeExpr phonemeExpr4 = Rule.parsePhonemeExpr("()|");
        Assertions.assertEquals(2, phonemeExpr4.size());

        // Step 9: Parse a pattern with an empty alternative flanked by empty groupings, expecting an exception.
        Assertions.assertThrows(IllegalArgumentException.class, () -> {
            Rule.parsePhonemeExpr("()|()");
        });
    }
}

